import React, { useState, useEffect, useCallback } from 'react';
import './App.css';
import ConnectionStatus from './components/ConnectionStatus';
import MarketSummary from './components/MarketSummary';
import MarketSelector from './components/MarketSelector';
import SignalDisplay from './components/SignalDisplay';
import HistoricalChart from './components/HistoricalChart';
import WebSocketDebug from './components/WebSocketDebug';
import { useWebSocket } from './hooks/useWebSocket';
import { convertSignalsToMarketFormat } from './utils/dataProcessing';

function App() {
  const [environment, setEnvironment] = useState('prod');
  const [selectedMarket, setSelectedMarket] = useState('ES');
  const [marketData, setMarketData] = useState({});
  const [scoreHistory, setScoreHistory] = useState([]);
  const [connectionStatus, setConnectionStatus] = useState('DISCONNECTED');
  const [lastUpdate, setLastUpdate] = useState(null);

  const websocketUrl = environment === 'local' 
    ? 'ws://localhost:8765' 
    : 'ws://134.209.184.5:8765';

  console.log('Current WebSocket URL:', websocketUrl);
  console.log('Environment:', environment);

  const onMessage = useCallback((data) => {
    console.log('Received WebSocket message:', data);

    if (data.type === 'error') {
      console.error('WebSocket error:', data.message);
      return;
    }

    // Check if we have actual data
    if (!data || (!data.data && !data.signals_by_market)) {
      console.warn('No data in message:', data);
      return;
    }

    // Handle different data formats
    let processedData;

    // Direct signals_by_market at root level
    if (data.signals_by_market) {
      console.log('Processing signals_by_market format');
      processedData = convertSignalsToMarketFormat(data);
    }
    // Data wrapped in 'data' property
    else if (data.data) {
      const rawData = data.data;
      if (rawData.signals_by_market) {
        console.log('Processing nested signals_by_market format');
        processedData = convertSignalsToMarketFormat(rawData);
      } else {
        console.log('Using data as-is');
        processedData = rawData;
      }
    }
    // Already in correct format
    else if (data.ES || data.NQ || Object.keys(data).some(k => k.match(/^[A-Z]+$/))) {
      console.log('Data appears to be in market format already');
      processedData = data;
    }

    console.log('Processed market data:', processedData);

    if (processedData && Object.keys(processedData).length > 0) {
      setMarketData(processedData);
      setLastUpdate(new Date());

      if (processedData[selectedMarket]) {
        updateScoreHistory(processedData[selectedMarket]);
      }
    } else {
      console.warn('No valid market data after processing');
    }
  }, [selectedMarket]);

  const { sendMessage, isConnected, connectionAttempts, lastError, connectionState } = useWebSocket(
    websocketUrl,
    onMessage,
    () => {
      console.log('WebSocket connected successfully!');
      setConnectionStatus('Connected');
    },
    () => {
      console.log('WebSocket disconnected');
      setConnectionStatus('DISCONNECTED');
    }
  );

  useEffect(() => {
    if (isConnected) {
      // Send initial request
      sendMessage({ type: 'get_latest' });

      // Set up polling with error handling
      const interval = setInterval(() => {
        if (isConnected) {
          sendMessage({ type: 'get_latest' });
        }
      }, 5000); // Reduced frequency to 5 seconds to reduce server load

      return () => clearInterval(interval);
    }
  }, [isConnected, sendMessage]);

  const updateScoreHistory = (marketInfo) => {
    const longData = marketInfo.Long || {};
    const shortData = marketInfo.Short || {};

    const longScore = longData.final_score || 0;
    const shortScore = shortData.final_score || 0;

    const netDifference = Math.abs(longScore - shortScore);
    const winner = longScore > shortScore ? 'LONG' : shortScore > longScore ? 'SHORT' : 'NEUTRAL';

    setScoreHistory(prev => {
      const newHistory = [...prev, {
        timestamp: new Date(),
        longScore,
        shortScore,
        netDifference,
        winner
      }];

      const fiveMinutesAgo = new Date(Date.now() - 5 * 60 * 1000);
      return newHistory.filter(item => item.timestamp > fiveMinutesAgo);
    });
  };

  const availableMarkets = Object.keys(marketData).sort();

  return (
    <div className="app">
      <WebSocketDebug />
      <header className="app-header">
        <h1>ImpViz Active Trader</h1>
        <ConnectionStatus 
          status={connectionStatus} 
          lastUpdate={lastUpdate} 
          connectionAttempts={connectionAttempts}
          lastError={lastError}
          connectionState={connectionState}
        />
      </header>

      <div className="controls">
        <MarketSelector 
          markets={availableMarkets}
          selectedMarket={selectedMarket}
          onMarketChange={setSelectedMarket}
        />
        <button 
          className="env-toggle"
          onClick={() => setEnvironment(env => env === 'prod' ? 'local' : 'prod')}
        >
          {environment === 'prod' ? 'Production' : 'Local'}
        </button>
      </div>

      <MarketSummary marketData={marketData} />

      {/* Debug info */}
      <div style={{ 
        background: 'rgba(0,0,0,0.5)', 
        padding: '10px', 
        margin: '10px 0',
        borderRadius: '5px',
        fontSize: '11px',
        color: '#888'
      }}>
        <div>Markets available: {availableMarkets.join(', ') || 'None'}</div>
        <div>Selected market: {selectedMarket}</div>
        <div>Has data for selected: {marketData[selectedMarket] ? 'Yes' : 'No'}</div>
        <div>Data keys: {Object.keys(marketData).join(', ') || 'None'}</div>
      </div>

      {marketData[selectedMarket] ? (
        <>
          <SignalDisplay 
            marketData={marketData[selectedMarket]}
            marketName={selectedMarket}
          />
          <HistoricalChart scoreHistory={scoreHistory} />
        </>
      ) : (
        <div style={{
          padding: '20px',
          textAlign: 'center',
          color: '#666'
        }}>
          No data available for {selectedMarket}
        </div>
      )}
    </div>
  );
}

export default App;
